// import { AppBar, Toolbar } from "@material-ui/core";
import React from "react";


class Header extends React.Component {
    titles = {
        header: 'My portfolio'
    }


    render() {
        return <div className="container-fluid">
            <div className="row">
                <div className="col-12">
                    {this.titles.header}
                </div>
            </div>
        </div>
    }
}

export default Header;
